import React from 'react';
import "./Product.css";

const Product = (props) => {
    // console.log(props);

    const {name,img,seller,price,ratings}=props.product;

    return (
        <div className='product'>
            <img src={img} alt=""/>
            <p className='product-name'>{name}</p>
            <p>Price:{price}</p>
            <p><small>Seller:{seller}</small></p>
            <p><small></small></p>
        </div>
    );
};

export default Product;
